import React, { useState, useEffect } from "react";
import InvestorsTable from "./InvestorsTable";
import InvestorDetails from "./InvestorDetails";
import Investor from "../Entity/Investor";

function DataTables() {
    // let intial: Investor = {
    //     firm_id: 0,
